import React, {Component, Fragment} from "react";
import {
    Card,
    CardHeader,
    CardBody,
    CardFooter,
    CardTitle,
    Row,
    Col
} from "reactstrap";
import Button from "./Button";

class WhatsApp extends React.Component {
    render() {
        return (
            <Fragment>
                <div className="content">
                    <Button url={'/twitter'} color={'info'} title={'Twitter'}/>
                </div>
            </Fragment>
        );
    }
}

export default WhatsApp;
